(2, 'c', 'style.css', '2013-12-28 16:30:08', '/*\n* Green\n*/\n\n/*  --------------------------- Body ---------------------------*/\nbody, .bgBody {\n	margin-top:	    0px;\n	margin-left:    8px;\n	margin-right:   8px;\n	margin-bottom:  0px;\n	padding:        0px;\n	border:         0px;\n	font-family:    Liberation sans, Arial, Sans-serif;\n	font-size:	    9pt;\n	background: 	white;\n}\nbody.main {\n	background-color: #f5f5f5;\n	text-align: center;\n}\n\n.bodyPrint {\n	margin: 5px;\n	color:	black;\n}\n\n.bodyImage {\n	margin:     0px;\n	background: #F0F8FF;\n	overflow:   hidden;\n}\n\n/*  ---------------------- Global layout -----------------------*/\n\n/* Top-most table on the layout */\n.topTable {\n	width:  940px;\n}\n\n.topContainer {\n	margin: 16px auto;\n	width: 960px;\n}\n\n.topContainer>tr>td, .topContainer>tbody>tr>td {\n	border: 1px solid #dedede;\n	border-radius: 6px;\n	-moz-border-radius: 6px;\n	-webkit-border-radius: 6px;\n}\n.topContainerBorder {\n	border: 1px solid #c4c4c4;\n	border-radius: 6px;\n	-moz-border-radius: 6px;\n	-webkit-border-radius: 6px;\n	padding: 9px 9px 12px 9px;\n	background: white;\n	min-height: 600px;\n	overflow: auto;\n}\n.topBanner {\n	background: white url(top_background.jpg) no-repeat;\n	height: 129px;\n	margin-bottom: 10px;\n	position: relative;\n}\n.topBannerText {\n	font-size:   10pt;\n	font-weight: bold;\n	color: white;\n	font-weight: bold;\n	position: absolute;\n	bottom: 8px;\n	left: 10px;\n}\n.minHeight {\n	height: 500px;\n}\n\n.standaloneContents {\n	width: 			716px;\n	margin-left: 	auto;\n	margin-right: 	auto;\n}\n\n/* System header bar */\n.headerBar {\n	border:  0px;\n	margin:  0px;\n}\n\n/* Bar that shows the logged user */\n.loginDataBar {\n	background:				-moz-linear-gradient(center top, #FFFFFF, #FFFFFF 50%, #EDEDED 100%);\n	background:				-webkit-gradient(linear, center top, center bottom, color-stop(0%, #FFFFFF), color-stop(50%, #FFFFFF), color-stop(100%, #EDEDED));\n	border:					1px solid #CCCCCC;\n	overflow:				hidden;\n	padding-right:			7px;\n	padding-top:			3px;\n	padding-bottom:			3px;\n	line-height:			12px;\n	text-align:				right;\n	background-color:		#F7F7F7;\n	-moz-border-radius: 	4px;\n	-webkit-border-radius:	4px;\n	border-radius: 			4px;\n}\n\n/* Span that shows data on the logged user bar */\n.loginData {\n	font-weight:	bold;\n	font-size:		8pt;\n	color:			#3E3E3D;\n	font-family:    Liberation sans, Arial, Sans-serif;\n	padding-left:	5px;\n}\n\n/* Even rows on result lists */\n.ClassColor1 {\n	background-color: #ffffff;\n}\n\n/* Odd rows on result lists */\n.ClassColor2 {\n	background-color: #fffcf4;\n}\n\n/* Rows when the mouse is over it */\n.ClassColorSelected {\n	background-color: #ffeed7;\n	text-decoration: none;\n}\n\n.tdHeaderContents, .ClassColor1>td, .ClassColor2>td, .ClassColorSelected>td {\n	padding:    	4px 3px !important;\n	line-height: 	19px !important;\n}\n\n/* Messages that appear next to fields (like date format) */\n.fieldDecoration {\n	color: red !important;\n}\n\n/* Messages that appear at the bottom of the page */\n.footerNote {\n	font-weight: bold;\n	text-align:  center;\n	width:       100%;\n	color:       #3E3E3D;\n}\n\n/* Pagination text for search results */\n.pagination {\n}\n\n/* Pagination links */\n.paginationLink {\n	font-weight: bold;\n}\n\n/* Current page in pagination */\n.currentPage {\n	font-weight: bold;\n	color: red;\n}\n\n/* Contents on print windows */\n.printContent {\n	background-color: white;\n	border: none;\n}\n\n/* Title on print pages */\n.printTitle {\n	color:       black;\n	font-weight: bold;\n	font-size:   10pt;\n	text-align:  center;\n}\n\n/* Labels on print page */\n.printLabel {\n	color:       black;\n	font-weight: bold;\n	font-size:   9pt;\n	font-style:  italic;\n	text-align:  right;\n	vertical-align: top;\n}\n\n/* Column headers */\nth.printLabel {\n	text-align: center !important;\n}\n\n/* Data on print page */\n.printData {\n	color: black;\n	vertical-align: top;\n}\n\n/* Elements with border */\n.printBorder, .printBorder th, .printBorder td {\n	border: 1px solid black;\n	border-collapse: collapse;\n	padding: 1px 2px;\n}\n\n/*  -------------------------- Help ----------------------------*/\n\n.helpWindowBody {\n	margin:     0px;\n	cursor:     default;\n	background: #f9f9f9;\n}\n\n.helpWindowTable {\n	border:     0px;\n	width:      100%;\n	height:     100%;\n	background: #f9f9f9;\n}\n\n.helpWindowTableContent {\n	color:       navy;\n}\n\nbr.small {\n	font-size: 6px;\n}\n\n/*  ------------------------ Tables ----------------------------*/\n\n.defaultTable, .defaultTableCenter {\n	border:          0px;\n	border-spacing:  0px;\n	border-collapse: collapse;\n	padding:         0px;\n	width:	    	 100%;\n	empty-cells:     show;\n}\n\n.standAloneFixedWidth {\n	width:	    	 716px !important;\n}\n\n.bordered {\n	border-bottom:		1px solid #CCCCCC;\n	border-spacing:		0px;\n	border-collapse:	collapse;\n}\n\n.fullBordered {\n	border:				1px solid #CCCCCC;\n}\n\n.defaultTableCenter {\n	text-align: center;\n	vertical-align: middle;\n}\n\n.defaultTableContent, .defaultTableContentHidden {\n	width:					716px;\n	_width:					714px;\n	padding:				0px;\n	margin:					10px 0px 4px;\n	border-spacing:			0px;\n	float:					left;\n}\n\n.defaultTableContent {\n	border:					1px solid #5ca57b;\n	border-radius:			4px 4px 4px 4px;\n	-moz-border-radius:		4px 4px 4px 4px;\n	-webkit-border-radius:	4px 4px 4px 4px;\n	box-shadow:				1px 3px 5px 1px rgba(0, 0, 0, 0.25);\n	-moz-box-shadow:		1px 3px 5px 1px rgba(0, 0, 0, 0.25);\n	-webkit-box-shadow:		1px 3px 5px 1px rgba(0, 0, 0, 0.25);\n}\n\n.standaloneContents .defaultTableContent, .standaloneContents .defaultTableContentHidden {\n	width: 100%;\n}\n\ntable.nested, table.nested.td, table.nested.th {\n	margin:          0px;\n	padding:         0px;\n	border-collapse: collapse;\n	border-spacing:  0px;\n}\n\nform {\n	display: inline;\n	margin:  0px;\n}\n\ntd, pre, legend {\n	font-family:    Liberation sans, Arial, Sans-serif;\n	font-size:		9pt;\n	color: 			#3E3E3D;\n}\n\npre {\n	display:inline;\n}\n\n\n.tdHeaderTable {\n	background-color:		#5ca57b;\n	border-bottom: 			1px solid white;\n	border-radius:			3px 0px 0px 0px;\n	-moz-border-radius:		3px 0px 0px 0px;\n	-webkit-border-radius:	3px 0px 0px 0px;\n	color:					#FFFFFF;\n	padding-left:			10px;\n    padding-top:			7px;\n	padding-bottom:			7px;\n    vertical-align: 		top;\n	font-size:				10pt;\n	font-weight:			bold;\n	text-align:				left;\n}\n\n.tdHelpIcon {\n	background-color:		#5ca57b;\n	border-bottom:			1px solid white;\n	border-radius:			0px 3px 0px 0px;\n	-moz-border-radius:		0px 3px 0px 0px;\n	-webkit-border-radius:	0px 3px 0px 0px;\n	padding-right:			9px;\n	padding-top: 			0px;\n    vertical-align: 		middle;\n}\n\n.ie .tdHelpIcon, .ie .tdHeaderTable {\n      border-top: none;\n}\n\n.tdHelpIcon img {\n	margin-left: 3px;\n}\n\n.innerBorder {\n}\n\n.bottomLeft {\n	height: 6px;\n}\n\n.bottomRight {\n	height: 6px;\n}\n\n.tdHeaderContents {\n	background-color:	#FFEED7;\n	color:				#3E3E3D;\n	text-align:			center;\n	border:				1px solid #FFFFFF;\n	font-family:    	Liberation sans, Arial, Sans-serif;\n	font-size:			9pt;\n	font-weight:		bold;\n}\n\n.tdContentTable {\n	padding: 8px;\n}\n\n.tdContentTableForms {\n	padding: 5px;\n}\n\n.tdContentTableLists {\n	padding: 1px;\n}\n\n.tdContentTableLists table {\n	border-spacing: 1px;\n}\n\n.tdContentTableForms table {\n	border-spacing: 3px;\n}\n\n.tdContentTableLists table td, .tdContentTableLists table th {\n	padding: 3px 4px;\n	line-height: 18px;\n}\n\n.tdContentTableForms table td, .tdContentTableForms table th {\n	padding-top: 3px;\n	padding-left: 2px;\n	padding-right: 2px;\n	padding-bottom: 3px;\n}\n\n.tdContents {\n	background:		transparent;\n	padding:		0px;\n	padding-left:	14px;\n	border:			none;\n	float:			left;\n	text-align:		left;\n	width: 			716px;\n	color: 			#3E3E3D;\n}\n\n.tdContentsStandalone {\n	text-align: 	left;\n	padding-left: 	0px;\n	width: 			100%;\n}\n\n.tdContentsCenter {\n	background:	    #FFFFFF;\n	text-align:     center;\n	vertical-align: middle;\n}\n\n.loadingMessage {\n	border:				#d15113 1px solid;\n	background-color: 	#FFF4E6;\n	color: 	        	#3E3E3D;\n	font-family:    	Liberation sans, Arial, Sans-serif;\n	font-size:      	9pt;\n	text-align:     	center;\n	padding:			0px 8px;\n	line-height:        20px;\n}\n\n.tablePrint {\n	width:	    	 100%;\n	border:          1px solid #808080;\n	border-spacing:  0px;\n	border-collapse: collapse;\n}\n\n.tdPrintHeader {\n	color:			 black;\n	font-weight:     bold;\n	text-align:      center;\n	vertical-align:  middle;\n	border:          1px solid #808080;\n	border-spacing:  0px;\n	border-collapse: collapse;\n}\n\n.tdPrintData {\n	color:			 black;\n	text-align:      left;\n	vertical-align:  middle;\n	border:          1px solid #808080;\n	border-spacing:  0px;\n	border-collapse: collapse;\n}\n\n.tdPrintDataBold {\n	color:			 black;\n	font-weight:     bold;\n	text-align:      left;\n	vertical-align:  middle;\n	border:          1px solid #808080;\n	border-spacing:  0px;\n	border-collapse: collapse;\n}\n\n/*  -------------------------- Menus ---------------------------*/\n\n.menuHolder {\n	border:			0px;\n	padding:		0px;\n	vertical-align:	top;\n	width:			210px !important;\n	float:          left;\n	margin-top:		10px;\n}\n\n/* move to top the same margin as .menu uses on to, so the first item won''t be shifted */\n.menuContainer {\n	width:					210px;\n	border:					1px solid #5ca57b;\n	border-radius:			4px 4px 4px 4px;\n	-moz-border-radius:		4px 4px 4px 4px;\n	-webkit-border-radius:	4px 4px 4px 4px;\n	box-shadow:				1px 3px 5px 1px rgba(0, 0, 0, 0.25);\n	-moz-box-shadow:		1px 3px 5px 1px rgba(0, 0, 0, 0.25);\n	-webkit-box-shadow:		1px 3px 5px 1px rgba(0, 0, 0, 0.25);\n	padding: 0;\n	text-align: left;\n	margin: 0px;\n}\n\n.menu, .menuHover {\n	width:				210px !important;\n	background-color:	#5ca57b;\n	border-bottom: 		1px solid white;\n	margin: 			0px;\n	padding:  			0px;\n	overflow: 			hidden;\n	list-style: 		none;\n}\n\n.firstMenu, .firstMenuHover {\n	*margin-bottom: -3px;\n}\n\n.menuText {\n	padding-top: 	7px;\n	padding-bottom:	2px;\n	padding-left:	10px;\n	font-family:   	Liberation sans, Arial, Sans-serif;\n	color: 			#FFFFFF;\n	font-size: 		10pt;\n	font-weight:	bold;\n	display:		block;\n	height:			20px;\n}\n\n.menuBullet {\n	display:		none;\n}\n\n.subMenu, .subMenuHover {\n	background-color: 		white;\n	background-image: 		url(''block.png'');\n	background-position: 	9px 4px;\n	background-repeat: 		no-repeat;\n	border:					none;\n	width: 				210px;\n	padding: 1px 0;\n}\n\n.subMenuText {\n	font-family:   	Liberation sans, Arial, Sans-serif;\n	color: 			#3E3E3D;\n	font-size:		10pt;\n	margin-left:	5px;\n	padding-top:	1px;\n	padding-bottom:	1px;\n	width: 			180px;\n	display:		inline-block;\n}\n\n.subMenuBullet {\n	height:				3px;\n	width:				3px;\n	background-color:	#5ca57b;\n	margin:				9px 1px 3px 11px;\n	font-size:          1px;\n	display:			inline-block;\n	vertical-align:		top;\n}\n\n.menuHover .menuText, .firstMenuHover .menuText, .lastMenuHover .menuText {\n	background-color:	#C8CE07;\n}\n\n.subMenuHover .subMenuText {\n	text-decoration: underline;\n}\n\n.firstMenu, .firstMenuHover {\n	border-radius:			3px 3px 0px 0px;\n	-moz-border-radius:		3px 3px 0px 0px;\n	-webkit-border-radius:	3px 3px 0px 0px;\n}\n\n.lastMenu, .lastMenuHover {\n	border-bottom: none;\n	border-radius:			0px 0px 3px 3px;\n	-moz-border-radius:		0px 0px 3px 3px;\n	-webkit-border-radius:	0px 0px 3px 3px;\n}\n\n.subMenuContainer {\n	margin: 0px;\n	padding: 0px;\n	border-top: 1px solid white;\n}\n\n.firstSubMenu {\n	padding-top: 6px;\n}\n\n.lastSubMenu {\n	padding-bottom: 6px;\n}\n\n/*  -------------------------- Links ---------------------------*/\n\na {\n	text-decoration: none;\n	color:	    	 blue;\n}\n\na.default {\n	text-decoration: underline !important;\n	color:	    	 blue !important;\n}\n\na.linkList, a.profileLink, a.adminProfileLink, a.operatorProfileLink {\n	color: blue;\n}\n\na.linkList:hover, a.profileLink:hover, a.adminProfileLink:hover, a.operatorProfileLink:hover {\n	color: red;\n}\n\n\n/*  ----------------------- Form fields ------------------------*/\n\n/* Buttons */\nbutton, .button, .linkButton, .ButtonDisabled {\n\n	background:				-moz-linear-gradient(center top, #faf4e2 0%, #FDCE7E 100%);\n	background:             -webkit-linear-gradient(top,  #faf4e2 0%,#FDCE7E 100%);\n	background:				-webkit-gradient(linear, center top, center bottom, color-stop(0%, #faf4e2), color-stop(100%, #FDCE7E));\n	background-color:		#fcdca6;\n	border:					1px solid #EC9A38;\n	border-radius:			4px 4px 4px 4px;\n	-moz-border-radius:		4px 4px 4px 4px;\n	-webkit-border-radius:	4px 4px 4px 4px;\n	text-shadow: 			1px 1px 2px #faf4e2;\n	color:					#414141;\n	font-family:    		Liberation sans, Arial, Sans-serif;\n	font-size:				9pt;\n	font-weight:			normal;\n	cursor:					pointer;\n	padding: 				5px 10px;\n}\n\n.ieold button, .ieold .button, .ieold .linkButton, .ieold .ButtonDisabled {\n  padding: 1px 0px !important;\n}\n\n.ie button, .ie .button, .ie .linkButton, .ie .ButtonDisabled {\n  padding: 4px 8px;\n  filter: progid:DXImageTransform.Microsoft.gradient(startColorstr=''#FAF4E2'', endColorstr=''#FDCE7E''); /* IE gradients */\n  background-color: transparent;\n}\n\n/* Disabled buttons */\n.ButtonDisabled {\n	background:				-moz-linear-gradient(center top, #FFFFFF, #DDDDDD 100%);\n	background:				-webkit-gradient(linear, center top, center bottom, color-stop(0%, #FFFFFF), color-stop(100%, #DDDDDD));\n	background-color:		#e9eef4;\n	color:					#888888;\n	border-color:			#cccccc;\n}\n\nbutton:hover, .button:hover, .linkButton:hover {\n	color:			#ff4800;\n	border:			1px solid #ff5b1a;\n}\n\n/* General inputs */\ninput, textarea, select, .radio, .printButton {\n	border: 		#CCCCCC 1px solid;\n	color: 			#3E3E3D;\n	font-family:   	Liberation sans, Arial, Sans-serif;\n	font-size: 		9pt;\n	font-weight:    normal;\n	margin: 		0px\n}\n\ninput, textarea, select, .radio, .checkbox, option {\n  background-color: white;\n}\n\n/* Hide mozilla inner button, when you click on virtual keyboard buttons it won''t select the text*/\ninput::-moz-focus-inner {\n	border: none;\n}\n\n/* Select boxes */\nselect {\n	height: 22px;\n	background-color:white;\n	vertical-align: top;\n}\n\noption {\n	padding: 3px 6px 2px 2px;\n}\n\n/* Radios and checkboxes */\n.radio, .checkbox {\n	border: 1px solid #1e5180;\n}\n\n/* Enabled input boxes */\n.InputBoxEnabled {\n	background-color:	#FFFFFF;\n	color:				#3E3E3D;\n}\n\n/* Disabled input boxes */\n.InputBoxDisabled {\n	background-color:	#F5F5F5;\n	color: 				#3E3E3D;\n}\n\n/* Field sizes */\ninput.tiny, textarea.tiny, select.tiny {\n	width: 118px;\n}\ninput.small, textarea.small, select.small {\n	width: 168px;\n}\ninput.medium, textarea.medium, select.medium {\n	width: 218px;\n}\ninput.large, textarea.large, select.large {\n	width: 368px;\n}\ninput.full, textarea.full, select.full {\n	width: 98%;\n}\n\n/* Text fields padding */\ninput.tiny, textarea.tiny, input.small, textarea.small, input.medium, textarea.medium, input.large, textarea.large, input.full, textarea.full {\n	padding: 3px 2px;\n}\n\ninput {\n	padding: 3px 2px;\n}\n\n/* A div that looks like a field */\ndiv.fakeField, div.fakeFieldDisabled {\n	background-color:	#FFFFFF;\n	border:				#CCCCCC 1px solid;\n	color:				#3E3E3D;\n	font-family:    	Liberation sans, Arial, Sans-serif;\n	font-size:			9pt;\n	font-weight:		normal;\n	padding-left:		2px;\n	padding-right:		2px;\n	vertical-align:		top;\n	white-space:        normal;\n}\n\n/* A disabled div that looks like a field */\ndiv.fakeFieldDisabled {\n	background-color: #F5F5F5 !important;\n}\n\n/* Multi drop down definitions */\n.multiDropDownText {\n	color: 	     #3E3E3D;\n	font-family: Liberation sans, Arial, Sans-serif;\n	font-size: 	 9pt;\n}\n\n.multiDropDownLabel {\n	padding: 2px 4px 2px 0px !important;\n}\n\n\n.multiDropDown {\n	border: 	 1px solid #CCCCCC;\n	background:  white;\n	text-align: left;\n}\n\n.multiDropDownOption {\n	padding: 2px 2px 0px;\n}\n\n.multiDropDownDisabled {\n	border: 	 1px solid #CCCCCC;\n	background:  #F5F5F5;\n}\n\n.multiDropDownHover {\n	background:	#FFEED7;\n}\n\n/* Virtual keyboard definitions */\n.virtualKeyboardButton {\n	background:					-moz-linear-gradient(center top, #dce6f4 0%, #fcfefc 25%, #c4d6ec 100%);\n	background:					-webkit-gradient(linear, center top, center bottom, color-stop(0%, #dce6f4), color-stop(25%, #fcfefc), color-stop(100%, #c4d6ec));\n	background-color:			#dce6f4;\n	border:						1px solid #9CB3D8;\n	border-radius:				3px 3px 3px 3px;\n	-moz-border-radius:			3px 3px 3px 3px;\n	-webkit-border-radius:		3px 3px 3px 3px;\n	text-shadow: 				1px 1px 2px #faf4e2;\n	color: 	    				navy;\n	padding:					4px 4px 4px 4px;\n 	width:			            28px;\n   	margin:         		   	1px;\n   	cursor:            		   	pointer;\n}\n\n.ie .virtualKeyboardButton {\n	filter: progid:DXImageTransform.Microsoft.gradient(startColorstr=''#dce6f4'', endColorstr=''#fcfefc''); /* IE gradients */\n  	background-color: transparent;\n\n}\n\n.virtualKeyboardButtonHover {\n	background-color:			#f4faff;\n	background:					-moz-linear-gradient(center top, #f4faff 0%, #ffffff 25%, #e1f3ff 100%);\n	background:					-webkit-gradient(linear, center top, center bottom, color-stop(0%, #f4faff), color-stop(25%, #ffffff), color-stop(100%, #e1f3ff));\n}\n\n.ie .virtualKeyboardButtonHover {\n	filter: progid:DXImageTransform.Microsoft.gradient(startColorstr=''#f4faff'', endColorstr=''#ffffff''); /* IE gradients */\n  	background-color: transparent;\n}\n\n.virtualKeyboardContrastVeryLow {\n	color: #aac3db;\n}\n\n.virtualKeyboardContrastLow {\n	color: #90a5ba;\n}\n\n.virtualKeyboardContrastNormal {\n	color: #798b9c;\n}\n\n.virtualKeyboardContrastHigh {\n	color: #606e7b;\n}\n\n.virtualKeyboardContrastVeryHigh {\n	color: navy;\n}\n\n/* Fieldsets */\nfieldset {\n	border:	1px solid #008000;\n	margin:	5px 2px;\n}\n\n/* Fieldset legends */\nlegend {\n	font-weight: bold;\n	margin-left: 10px;\n}\n\n/* Labels on forms */\n.label {\n	text-align:     right;\n	font-weight:    bold;\n}\n\ntd.label {\n    padding-right:  4px !important;\n    padding-top: 7px !important;\n    padding-bottom: 7px !important;\n    vertical-align: top;\n}\nspan.label, span.lastLabel, span.inlineLabel {\n	font-weight: 	bold;\n	display: 		inline-block;\n}\n\nspan.label, span.lastLabel {\n	padding-top: 	3px !important;\n}\n\nspan.label, span.inlineLabel {\n	padding-right:	4px !important;\n}\n\n/* Labels that looks like headers */\n.headerLabel {\n	border: 			1px solid #FFFFFF;\n	background-color: 	#FFEED7;\n	color: 				#3E3E3D;\n	text-align:         right;\n	font-weight:        bold;\n    padding:            5px 5px 6px !important;\n}\n@-moz-document url-prefix() {\n    .headerLabel {\n        padding:            6px 5px 5px !important;\n    }\n}\n.headerField {\n	padding-left: 5px !important;\n}\n\n/* Decorated labels on forms */\n.decoratedLabel {\n	color:         red;\n	text-align:    right;\n	font-weight:   bold;\n	padding-right: 5px;\n}\n\n/* TDs that should be class label but have nested label spans */\n.nestedLabel {\n	text-align:    right;\n	padding-right: 0px;\n}\n\n/* Buttons on print pages */\n.printButton {\n	border:     black 1px solid;\n	color:      black;\n	background: #dddddd;\n}\n\n/* Horizontal rules */\nhr {\n	height:           0px;\n	border:           none;\n	border-top:       1px solid #008000;\n}\n\nhr.print {\n	height:           0px;\n	border:           none;\n	border-top:       1px solid black;\n}\n\n/* Image scroller (on profile or ad details) definitions */\n.imageContainer {\n	border:     1px solid #CCCCCC;\n	text-align: center;\n}\n\n.thumbnail {\n	margin: 1px;\n}\n\n.imageOnly {\n	margin: 0px !important;\n	padding: 0px !important;\n	border: none !important;\n}\n\n.imageContainer a {\n	color: #3E3E3D;\n	text-decoration: none;\n}\n\n.imageContainer a:hover {\n	color: red;\n}\n\n.imageIndex {\n}\n\n.imageRemove, .imageControls, .imageSetCaption, .imageDetails {\n	border-top: