px 0px 4px 4px;\n}\n\n.subMenuContainer {\n	margin: 0px;\n	padding: 0px;\n	border-top: 1px solid #cccccc;\n}\n\n.firstSubMenu {\n	padding-top: 6px;\n}\n\n.lastSubMenu {\n	padding-bottom: 6px;\n}\n\n/*  -------------------------- Links ---------------------------*/\n\na {\n	text-decoration: none;\n	color:	    	 blue;\n}\n\na.default {\n	text-decoration: underline !important;\n	color:	    	 blue !important;\n}\n\na.linkList, a.profileLink, a.adminProfileLink, a.operatorProfileLink {\n	color: blue;\n}\n\na.linkList:hover, a.profileLink:hover, a.adminProfileLink:hover, a.operatorProfileLink:hover {\n	color: red;\n}\n\n\n/*  ----------------------- Form fields ------------------------*/\n\n/* Buttons */\nbutton, .button, .linkButton, .ButtonDisabled {\n\n	background:				-moz-linear-gradient(center top, #faf4e2 0%, #FDCE7E 100%);\n	background:             -webkit-linear-gradient(top,  #faf4e2 0%,#FDCE7E 100%);\n	background:				-webkit-gradient(linear, center top, center bottom, color-stop(0%, #faf4e2), color-stop(100%, #FDCE7E));\n	background-color:		#fcdca6;\n	border:					1px solid #EC9A38;\n	border-radius:			4px 4px 4px 4px;\n	-moz-border-radius:		4px 4px 4px 4px;\n	-webkit-border-radius:	4px 4px 4px 4px;\n	text-shadow: 			1px 1px 2px #faf4e2;\n	color:					#414141;\n	font-family:    		Liberation sans, Arial, Sans-serif;\n	font-size:				9pt;\n	font-weight:			normal;\n	cursor:					pointer;\n	padding: 				5px 10px;\n}\n\n.ieold button, .ieold .button, .ieold .linkButton, .ieold .ButtonDisabled {\n  padding: 1px 0px !important;\n}\n\n.ie button, .ie .button, .ie .linkButton, .ie .ButtonDisabled {\n  padding: 4px 8px;\n  filter: progid:DXImageTransform.Microsoft.gradient(startColorstr=''#FAF4E2'', endColorstr=''#FDCE7E''); /* IE gradients */\n  background-color: transparent;\n}\n\n/* Disabled buttons */\n.ButtonDisabled {\n	background:				-moz-linear-gradient(center top, #FFFFFF, #DDDDDD 100%);\n	background:				-webkit-gradient(linear, center top, center bottom, color-stop(0%, #FFFFFF), color-stop(100%, #DDDDDD));\n	background-color:		#e9eef4;\n	color:					#888888;\n	border-color:			#cccccc;\n}\n\nbutton:hover, .button:hover, .linkButton:hover {\n	color:			#ff4800;\n	border:			1px solid #ff5b1a;\n}\n\n/* General inputs */\ninput, textarea, select, .radio, .printButton {\n	border: 		#CCCCCC 1px solid;\n	color: 			#0067a3;\n	font-family:    Liberation sans, Arial, Sans-serif;\n	font-size: 		9pt;\n	font-weight:    normal;\n	margin: 		0px;\n}\ninput, textarea, select, .radio, .checkbox, option {\n  background-color: white;\n}\n\n\n/* Hide mozilla inner button, when you click on virtual keyboard buttons it won''t select the text*/\ninput::-moz-focus-inner {\n	border: none;\n}\n\n/* Select boxes */\nselect {\n	height: 22px;\n	background-color:white;\n	vertical-align: top;\n}\noption {\n	padding: 3px 6px 2px 2px;\n}\n\n/* Radios and checkboxes */\n.radio, .checkbox {\n	border: 1px solid #1e5180;\n}\n\n/* Enabled input boxes */\n.InputBoxEnabled {\n	background-color:	#FFFFFF;\n	color:				#0067a3;\n}\n\n/* Disabled input boxes */\n.InputBoxDisabled {\n	background-color:	#F5F5F5;\n	color: 				#0067a3;\n}\n\n/* Field sizes */\ninput.tiny, textarea.tiny, select.tiny {\n	width: 118px;\n}\ninput.small, textarea.small, select.small {\n	width: 168px;\n}\ninput.medium, textarea.medium, select.medium {\n	width: 218px;\n}\ninput.large, textarea.large, select.large {\n	width: 368px;\n}\ninput.full, textarea.full, select.full {\n	width: 98%;\n}\n\n/* Text fields padding */\ninput.tiny, textarea.tiny, input.small, textarea.small, input.medium, textarea.medium, input.large, textarea.large, input.full, textarea.full {\n	padding: 3px 2px;\n\n}\n\ninput {\n	padding: 3px 2px;\n}\n\n/* A div that looks like a field */\ndiv.fakeField, div.fakeFieldDisabled {\n	background-color:	#FFFFFF;\n	border:				#CCCCCC 1px solid;\n	color:				#0067a3;\n	font-family:    	Liberation sans, Arial, Sans-serif;\n	font-size:			9pt;\n	font-weight:		normal;\n	padding-left:		2px;\n	padding-right:		2px;\n	vertical-align:		top;\n	white-space:        normal;\n}\n\n/* A disabled div that looks like a field */\ndiv.fakeFieldDisabled {\n	background-color: #F5F5F5 !important;\n}\n\n/* Multi drop down definitions */\n.multiDropDownText {\n	color: 	     #0067a3;\n	font-family: Liberation sans, Arial, Sans-serif;\n	font-size: 	 9pt;\n}\n\n.multiDropDownLabel {\n	padding: 2px 4px 2px 0px !important;\n}\n\n.multiDropDown {\n	border: 	 1px solid #CCCCCC;\n	background:  white;\n	text-align: left;\n}\n\n.multiDropDownOption {\n	padding: 2px 2px 0px;\n}\n\n.multiDropDownDisabled {\n	border: 	 1px solid #CCCCCC;\n	background:  #F5F5F5;\n}\n\n.multiDropDownHover {\n	background:	#e5f0fe;\n}\n\n/* Virtual keyboard definitions */\n.virtualKeyboardButton {\n	background:					-moz-linear-gradient(center top, #dce6f4 0%, #fcfefc 25%, #c4d6ec 100%);\n	background:					-webkit-gradient(linear, center top, center bottom, color-stop(0%, #dce6f4), color-stop(25%, #fcfefc), color-stop(100%, #c4d6ec));\n	background-color:			#dce6f4;\n	border:						1px solid #9CB3D8;\n	border-radius:				3px 3px 3px 3px;\n	-moz-border-radius:			3px 3px 3px 3px;\n	-webkit-border-radius:		3px 3px 3px 3px;\n	text-shadow: 				1px 1px 2px #faf4e2;\n	color: 	    				navy;\n	padding:					4px 4px 4px 4px;\n 	width:			            28px;\n   	margin:         		   	1px;\n   	cursor:            		   	pointer;\n}\n\n.ie .virtualKeyboardButton {\n	filter: progid:DXImageTransform.Microsoft.gradient(startColorstr=''#dce6f4'', endColorstr=''#fcfefc''); /* IE gradients */\n  	background-color: transparent;\n\n}\n\n.virtualKeyboardButtonHover {\n	background-color:			#f4faff;\n	background:					-moz-linear-gradient(center top, #f4faff 0%, #ffffff 25%, #e1f3ff 100%);\n	background:					-webkit-gradient(linear, center top, center bottom, color-stop(0%, #f4faff), color-stop(25%, #ffffff), color-stop(100%, #e1f3ff));\n}\n\n.ie .virtualKeyboardButtonHover {\n	filter: progid:DXImageTransform.Microsoft.gradient(startColorstr=''#f4faff'', endColorstr=''#ffffff''); /* IE gradients */\n  	background-color: transparent;\n}\n\n.virtualKeyboardContrastVeryLow {\n	color: #aac3db;\n}\n\n.virtualKeyboardContrastLow {\n	color: #90a5ba;\n}\n\n.virtualKeyboardContrastNormal {\n	color: #798b9c;\n}\n\n.virtualKeyboardContrastHigh {\n	color: #606e7b;\n}\n\n.virtualKeyboardContrastVeryHigh {\n	color: navy;\n}\n\n/* Fieldsets */\nfieldset {\n	border:	1px solid #9ab8d5;\n	margin:	5px 2px;\n}\n\n/* Fieldset legends */\nlegend {\n	font-weight: bold;\n	margin-left: 10px;\n}\n\n/* Labels on forms */\n.label {\n	text-align:     right;\n	font-weight:    bold;\n}\n\ntd.label {\n	padding-right:  4px !important;\n    padding-top: 7px !important;\n    padding-bottom: 7px !important;\n    vertical-align: top;\n}\n\nspan.label, span.lastLabel, span.inlineLabel {\n	font-weight: 	bold;\n	display: 		inline-block;\n}\n\nspan.label, span.lastLabel {\n	padding-top: 	3px !important;\n}\n\nspan.label, span.inlineLabel {\n	padding-right:	4px !important;\n}\n\n/* Labels that looks like headers */\n.headerLabel {\n	border: 			1px solid #FFFFFF;\n	background-color: 	#F5F5F5;\n	color: 				#0067a3;\n	text-align:         right;\n	font-weight:        bold;\n	padding:			5px 5px 6px !important;\n}\n@-moz-document url-prefix() {\n	.headerLabel {\n		padding:			6px 5px 5px !important;\n	}\n}\n.headerField {\n	padding-left: 5px !important;\n}\n\n/* Decorated labels on forms */\n.decoratedLabel {\n	color:         red;\n	text-align:    right;\n	font-weight:   bold;\n	padding-right: 5px;\n}\n\n/* TDs that should be class label but have nested label spans */\n.nestedLabel {\n	text-align:    right;\n	padding-right: 0px;\n}\n\n/* Buttons on print pages */\n.printButton {\n	border:     black 1px solid;\n	color:      black;\n	background: #dddddd;\n}\n\n/* Horizontal rules */\nhr {\n	height:           0px;\n	border:           none;\n	border-top:       1px solid #9ab8d5;\n}\n\nhr.print {\n	height:           0px;\n	border:           none;\n	border-top:       1px solid black;\n}\n\n/* Image scroller (on profile or ad details) definitions */\n.imageContainer {\n	border:     1px solid #CCCCCC;\n	text-align: center;\n}\n\n.thumbnail {\n	margin: 1px;\n}\n\n.imageOnly {\n	margin: 0px !important;\n	padding: 0px !important;\n	border: none !important;\n}\n\n.imageContainer a {\n	color: #0067a3;\n	text-decoration: none;\n}\n\n.imageContainer a:hover {\n	color: red;\n}\n\n.imageIndex {\n}\n\n.imageRemove, .imageControls, .imageSetCaption, .imageDetails {\n	border-top: 1px solid #CCCCCC;\n}\n\n/* Image view popup definitions */\n.popupThumbnailContainer {\n	padding-top:    10px;\n	padding-bottom: 10px;\n	padding-left:   20px;\n	padding-right:  0px;\n	height:         80px;\n	width:          100%;\n	border-bottom:  1px solid #CCCCCC;\n	overflow:       auto;\n	overflow-y:     hidden;\n	text-align:     left;\n	white-space:    nowrap;\n}\n\n.popupThumbnail {\n	vertical-align: middle;\n	margin-right:   20px;\n}\n\n.popupImageContainer {\n	text-align:     center;\n	padding:        20px;\n	padding-bottom: 0px;\n}\n\n/* Autocompletion divs */\n.autoComplete {\n	position:         absolute;\n	background-color: white;\n	border: 	      1px solid #CCCCCC;\n	margin:           0px;\n	padding:          0px;\n	cursor:           default;\n	font-weight:      normal;\n	z-index: 		  1;\n}\n\n.autoComplete ul {\n	list-style-type: none;\n	margin:          0px;\n	padding:         0px;\n	overflow:        auto;\n	overflow-x:      hidden;\n}\n\n.autoComplete ul li {\n	background:  white;\n	color:       #0067a3;\n	white-space: nowrap;\n	text-align:  left;\n	padding:     2px;\n}\n\n.autoComplete ul li.selected {\n	background:	     #e5f0fe;\n}\n\n.draggableList {\n	list-style-type:  none;\n	margin:           0px;\n	padding:          0px;\n	background-color: #F0F8FF;\n	border:           1px solid #CCCCCC;\n	padding-top:      10px;\n}\n\n.draggableList li {\n	margin-bottom:   10px;\n	cursor: move;\n}\n\n/*  ---------------- Page specific definitions -----------------*/\n\n/* Account history */\n\n.ClassColorCredit {\n	color: blue !important;\n}\n\n.ClassColorCredit a {\n	color: blue !important;\n}\n\n.ClassColorDebit {\n	color: red !important;\n}\n\n.ClassColorDebit a {\n	color: red !important;\n}\n\n\n/* Ad search */\n\n.productTitle, .productTitle a {\n	font-weight: bold;\n	color: red;\n	text-decoration: underline;\n}\n\n.productOwner {\n	font-weight: bold;\n	font-style: italic;\n}\n\n.productOwner a {\n	color:           blue;\n	text-decoration: underline;\n}\n\n.productDescription {\n}\n\nul.categoryLevel0 {\n	list-style-type: none;\n	margin-bottom: 10px;\n	padding-left: 20px;\n	margin-left: 0px;\n}\n\nul.categoryLevel1 {\n	list-style-type: square;\n	padding-left: 15px;\n	margin-bottom: 5px;\n	margin-left: 0px;\n}\n\nul.categoryLevel2 {\n	list-style-type: disc;\n	padding-left: 15px;\n	margin-left: 0px;\n}\n\nli.categoryLevel1 {\n	font-weight: bold;\n	padding-left: 0px;\n	color: #658DCF;\n}\n\nli.categoryLevel2 {\n	font-weight: normal;\n	padding-left: 0px;\n	color: #658DCF;\n}\n\nli.categoryLevel3 {\n	font-weight: normal;\n	padding-left: 0px;\n	color: #658DCF;\n}\n\nspan.categoryLevel1Text, span.categoryLevel2Text, span.categoryLevel3Text {\n	color: #0067a3;\n}\n\nspan.categoryLevel1TextHover, span.categoryLevel2TextHover, span.categoryLevel3TextHover {\n	color: blue;\n	text-decoration: underline;\n}\n\nspan.categoryCountText{\n	color: #658dcf;\n}\n\n/* Customized files list */\n.conflict {\n	color: red;\n}\n\n/* Messages */\n.unreadMessage {\n	font-weight: bold;\n}\n\n.readMessage {\n}\n\n.removedMessage {\n	font-style: italic;\n}\n\n.repliedMessage {\n}\n\ndiv.manualPage h1 {\n	font-size: 14pt;\n}\n\ndiv.manualPage h2 {\n	font-size: 12pt;\n}\n\ndiv.manualPage h3 {\n	font-size: 10pt;\n	margin: 0px;\n	padding: 0px;\n	margin-top: 20px;\n}\n\ndiv.manualPage a {\n	text-decoration: underline;\n	color: blue;\n}\n\na.manualLink {\n	color: #0067a3;\n}\n\na.manualLink:hover {\n	color: blue;\n	text-decoration: underline;\n}\n\n.alertNotification {\n	width: 		400px;\n	border: 	2px solid red;\n	padding: 	10px;\n	color: 		red;\n	font-size: 	11pt;\n}\n\nimg.quickAccessIcon {\n	border: none;\n	display: block;\n	margin-bottom: 5px;\n}\n\n.quickAccessLink {\n    background-color: white;\n    display: inline-block;\n    padding: 2px;\n    border: 1px solid white;\n    border-radius: 4px;\n    -moz-border-radius:	4px;\n	-webkit-border-radius: 4px;\n    width: 95%;\n}\n\n.quickAccessLink:hover {\n	background-color: #EBF2FA;\n	border: 1px solid #B0B0B0;\n}\n\n@media print {\n\n	.printButton {\n		display:none;\n	}\n}', NULL, NULL),
(3, 'c', 'general_news.jsp', '2013-12-27 13:42:00', NULL, 'S', NULL, NULL, '<%@ taglib uri="http://devel.cyclos.org/tlibs/cyclos-core" prefix="cyclos"%>\n\n&nbsp;\n<b><i><font size="2">Welcome to Cyclos, version ${cyclosVersion}</i></b>\n<p>This page can be modified by the administration (Content Management -\nStatic files - General news)\n<p>For communication &amp; discussions about cyclos &gt; <a\n	href="http://project.cyclos.org/forum"><font color="blue">Cyclos\nforum</font></a>\n(If you do not have a login you can ask for one at the <a\n	href="http://project.cyclos.org/index.php?option=com_contact&Itemid=230"><font\n	color="blue">contact page</font></a> of the Cyclos project site\n<p>\n<p>Best Regards\n<p><font color="#006699">-- The cyclos team --\n\n</div>', NULL, NULL);
